import './App.css';
const fruits = ["apple", "orange", "banana", "pear", "laichi", "strawberry"];
const [a, b, c, ...other] = fruits;
// equivalent to
// const a = fruits[0];
// const b = fruits[1];
// const c = fruits[2];

const employees = [
  { id: 1, name: 'Alice', country: 'Austria' },
  { id: 2, name: 'Bob', country: 'Belgium' },
  { id: 3, name: 'Carl', country: 'Canada' },
  { id: 4, name: 'Dean', country: 'Denmark' },
  { id: 5, name: 'Ethan', country: 'Egypt' },
];

function Fruit() {
  return (
    <>
      {fruits.map(el => {
        return (
          <div>{el}</div>
        );
      })}
    </>

  );

}

function Employee() {
  const results = [];
  for (const employee of employees) {
    results.push(
      <div key={employee.id}>
        <h2>name: {employee.name}</h2>
        <h2>country: {employee.country}</h2>

        <hr />
      </div>
    );
  }

  return (
    <div className="hi">
      {results}
    </div>
  );
}

function Employee1() {
  return (
    <div key={employee.id}>
      <h2>name: {employee.name}</h2>
      <h2>country: {employee.country}</h2>
      <hr />
    </div>
  );
}

function App() {

  return (
    <>
      <Fruit />
      <Employee />
    </>

  );
}

export default App;
